class App extends Component {
  state = {
    items: [
      { id: 1, title: "item #1" },
      { id: 2, title: "item #2" },
      { id: 3, title: "item #3" },
      { id: 4, title: "item #4" },
      { id: 5, title: "item #5" },
    ],
  };

  render() {
    const { items } = this.state;
    return (
      <div className="App">
        <h1>Hello</h1>
        <Carousel>
          <Card />
        </Carousel>
      </div>
    );
  }
}

export default App;
